    if (clk'event and clk = '1') then
        if state = st1_idle then
            row <= "000";
--        elsif state = st5_store_tactels and tactel_counter = "11111" and column = "1111" then
        elsif state = st5_store_tactels and tactel_counter = "11111" and column = "1010" then
            row <= row + 1;
        end if;
    end if;
end process;

-----------------------------------------------------
