    if (clk'event and clk = '1') then
        if(state = st5_store_tactels and tactel_counter = "11111" and row < "101" and column < "1011") then
            CE_DAT_REG <= '1';                                                  -- Se escribe cuando se han recidido los 32 bits de cada tactel           
        else
            CE_DAT_REG <= '0';
        end if;
    end if;
end process;

